RULES_ITEM.SQL_TEXT:
declare 
    v_user_name varchar2(2000);
    v_user_is number;
begin 

    v_user_is := pkg_sec.get_cu();
    select un 
      into v_user_name 
      from users 
     where user_id = v_user_is;
    util.setvalcharbyid(:xitor_id, id.requirement.cf.i_created_by, v_user_name);
    
end;

declare
    v_i_comments clob;
    v_user varchar2(2000);
    v_comment clob;
    v_user_id number;
begin
    
    v_i_comments := util.getvalmemobyid(:pk, id.requirement.cf.i_comments);
    if v_i_comments is null then return; end if;
    v_user_id := pkg_sec.get_cu();
    select util.getvalstrbyid(xitor_id, id.users.cf.us_full_name) 
      into v_user 
      from users 
     where user_id = v_user_id;     
    v_comment := v_user || ' ' || to_char(current_date, 'mm/dd/yyyy hh12:miAM') || ' CST ' || chr(10) || v_i_comments || chr(10) || chr(10) || util.getvalmemobyid(:pk, id.requirement.cf.i_comment_history);
    util.setvalmemobyid(:pk, id.requirement.cf.i_comment_history, v_comment);
    util.setvalmemobyid(:pk, id.requirement.cf.i_comments, null);

end;

declare
    v_subject varchar2(4000);
    v_body clob;
    v_to_email varchar2(4000);
    v_site_name varchar2(4000);
    v_link varchar2(4000);
    v_dev_est_hours number;
begin

    if nvl(util.getvalnumbyid(:pk, 1000067150 /*id.requirement.cf.req_create_ov_change_request*/), 0) = 0 then
        return;
    end if;

    select value into v_site_name from param_system where name = 'DomainName';
    v_to_email := 'support@onevizion.com';
    v_link := pkg_rpt.get_trackor_edit_url(:pk);
    v_dev_est_hours := util.getvalnumbyid(:pk, id.requirement.cf.req_development_estimate_hours);
    v_subject := v_site_name || ' ' || nvl(util.getvalstrbyid(:pk, id.requirement.cf.req_project_name), 'Managed Services') || ' - ' || util.getvalstrbyid(:pk, id.requirement.cf.xitor_key) || ': ' || util.getvalstrbyid(:pk, id.requirement.cf.i_issue_name);
    v_body := util.getvalstrbyid(:pk, id.requirement.cf.i_project_detailed_description) || '<br><br><br>' || 'Customer Request Link: <a href="' || v_link || '">' || v_link || '</a><br>Customer Request ID: ' || util.getvalstrbyid(:pk, id.requirement.cf.xitor_key) || '<br>Development Estimate (hours): ' || v_dev_est_hours || ' ';

    util.sendmail(
        subject => v_subject,
        message => v_body,
        sender => 'no-reply@onevizion.com',
        recipient => v_to_email,
        style => 'html'
    );

end;

declare
    v_xitor_id number;
    v_text varchar2(4000);
begin

    select chat.trackor_id, cm.text
      into v_xitor_id, v_text
      from chat
      join chat_message cm on (cm.chat_id = chat.chat_id)
     where cm.chat_message_id = :chat_message_id;

    if util.isflagset('I_COMMENTS to chat ' || v_xitor_id) = 1 then
        util.clearflag('I_COMMENTS to chat ' || v_xitor_id);
        return;
    end if;
    
    util.setflag('I_COMMENTS to chat ' || v_xitor_id);
    
    util.setvalcharbyid(v_xitor_id, id.requirement.cf.i_comments, v_text);

end;

declare
    v_chat_msg_id number;
    v_chat_id number;
    v_temp varchar2(4000);
begin

    if util.getvalstrbyid(:pk, id.requirement.cf.i_comments) is null then
        return;
    end if;
    
    if util.isflagset('I_COMMENTS to chat ' || :pk) = 1 then
        util.clearflag('I_COMMENTS to chat ' || :pk);
        return;
    end if;
    
    util.setflag('I_COMMENTS to chat ' || :pk);
    
    begin
        select chat_id
          into v_chat_id
          from chat
         where trackor_id = :pk;
    exception when no_data_found then
        v_chat_id := null;
    end;
    
    if v_chat_id is null then
        v_chat_id := pkg_chat.create_trackor_chat(:pk);
    end if;
    
    v_chat_msg_id := pkg_chat.create_msg_temp(v_chat_id, pkg_sec.get_cu(), util.getvalstrbyid(:pk, id.requirement.cf.i_comments));
    pkg_chat.finalize_msg_and_notify(v_chat_msg_id, v_temp);

end;
